import data from "./BD/DATA.json";
import { useEstate, useEffect } from "react";

function App() {

  //Variables.

  const [productos, setProductos] = useEstate([]);


  //promesa para obtener los datos.
  const resolverdata = () => {
    return (
      new Promise((resolve, reject) => {
        resolve(data);
      }
      )
    )
  }

  //setear la promesa

  resolverdata()
    .them((resolucion) => {

      setProductos(resolucion)
    }
    )




  return (
    <div className="App">

    </div>
  );
}

export default App;
